import React from "react";
import { Button, Container, Segment } from "semantic-ui-react";

export const Fronti = () => {
  return (
      <Container>
    <Segment  tertiary clearing size='small'>
      
      <Button floated="right" content="Ndrysho" color="black"></Button>
    </Segment>
    </Container>
  );
};
